- |start| <= |end|
- no other characters (whitespace or any other thinds) around `..` And multiple ranges and singletons are separated with one or more whitespaces. EXAMPLE: - `1..4` expands to `[1, 2, 3, 4]`;
- `1..1` expands to `[1]`;
- `4..1` expands to empty list `[]`; - `-1..-4` expands to `[-1, -2, -3, -4]`.
- `-4..-4` expands to `[-4]`
- `-4..-1` expands to empty list `[]`; - Tokens like `-4..4` `1 ..3`, `0`, `-3..0`, `-3..3` are not allowed. "-1..-4 1..4" expands to [-1, -2, -3, -4, 1, ,2 , 3, 4], and meaning that band 1 to 4 with spin down and band 1 to 4 with spin up form the total basis. basis_labels list of strings : Labels of each band in the basis. This field is optional, or it must have the same length with expanded basis_list. nac_fname string : File name of the pre-calculated NAC by last procedure (namd_lmi nac -c config). efield_fname string : Name of the optical field description file. If no optical field is applied, this field can be commented out. hamil_fname string : File name of output Hamiltonian. propmethod string : Numerical method to solve of time-dependent Schrodinger equation (TDSE). Here are supported methods: Expm: Matrix exponentiation by Padé approximant . Exact: Matrix power by diagonalization . FiniteDifference/FD: Solve TDSE using finite difference method. This method usually requires fine time steps in the next step . LiouvilleTrotter/LT: Using Trotter formula to solve TDSE, proposed by Akimov, A. V., & Prezhdo, O. V. J. Chem. Theory Comput. 2014, 10, 2, 789–804 It should be noted that Expm, Exact are usually slow while they have large tolerance of time step, resulting in much higher performance beyond FiniteDifference. Large time step also can be used with LiouvilleTrotter method, while it requires the off-diagonal elements of Hamiltonian to be real, which are usually not viable for photo-excitation processes. scissor float : Scissor opeartor for the gap correction. The photo-excitation process requires a high-precision time-averaged band gap over AIMD, and this parameter can modify the gap to target value. Optical field description The efield_template.rhai should read like //
// Example rhai script for ELECTRIC FIELD input
//
// This script uses `rhai` as the scripting language.
//
// For detailed usage of `rhai`, please see https://rhai.rs/book and turn to
// chapter "Scripting Language".
//
//
// Available operators:
// + +=
// - -=
// * *=
// / /=
// % %= (modulo operator)
// ** **= (power operator, `a ** b` equals `a` raised to the `b` power)
// == !=
// < <=
// > >=
// .. ..= ( .. is exclusive range, ..= is inclusive range )
// example: (1 .. 9) == (1 ..= 8)
//
// Detailed help: https://rhai.rs/book/language/num-op.html
//
// Pre-defined constants:
//
// - e: Euler's number, aka the base of natural logarithms
// - pi: π
//
// Pre-defined mathematical functions:
//
// - trigonometric:
// sin cos tan
// sinh cosh tanh
// asin acos atan
// asinh acosh atanh
//
// - numerical:
// sqrt(x)
// exp(x) (base of E)
// ln(x) (base of E)
// log(x) (base of 10), or log(x, base)
//
// - rounding:
// floor
// ceiling
// round
// int
// fraction
//
// - conversion:
// to_degrees
// to_radians
//
// - comparison:
// min
// max
//
//
// You must define a function named `efield` with only one parameter typed with float64.
//
// And this function must return an array with exactly 3 float64 elements.
//
// This function will be evaluated from `t=0.0` to `t=namdtime*potim` (exclusive)
//
fn efield(t) { let hbar = 0.658212; // reduced planck constant (eV/fs) let amp = 0.005; // amplitude = 0.005 (Volt/Angstrom) let hnu = 1.4; // photon energy = h * nu = 1.4 (eV) let omega = hnu / hbar; // omega = hnu / hbar (rad/fs) let x = amp * cos(omega * t); // electric field at `x` direction at time `t` let y = amp * sin(omega * t); // electric field at `y` direction at time `t` let z = 0.0; // no electric field at `z` direction return [x, y, z]; // this statement is required.
} where the contents after with // are just comments for rhai syntax illustration. This file describes an persistent uniform \(\sigma^+\) optical field, with \(h\nu = 1.4 \mathrm{eV}\), amplitude \(A_0 = 0.005 \mathrm{V/Angstrom}\). If you want to impose an optical pulse, an envelop function should be used before return [x, y, z]. For example, a Gaussian pulse: fn efield(t) { let hbar = 0.658212; // reduced planck constant (eV/fs) let amp = 0.005; // amplitude = 0.005 (Volt/Angstrom) let hnu = 1.4; // photon energy = h * nu = 1.4 (eV) let omega = hnu / hbar; // omega = hnu / hbar (rad/fs) let x = amp * cos(omega * t); // electric field at `x` direction at time `t` let y = amp * sin(omega * t); // electric field at `y` direction at time `t` let z = 0.0; // no electric field at `z` direction let sigma = 1000.0; // sigma of gaussian function, in femto second let mu = 1000.0; // center of the pulse, in femto second let envelop = exp(-(t-mu)**2 / sigma**2 / 2.0); return [x * envelop, y * envelop, z * envelop];
} a sine pulse: fn efield(t) { let hbar = 0.658212; // reduced planck constant (eV/fs) let amp = 0.005; // amplitude = 0.005 (Volt/Angstrom) let hnu = 1.4; // photon energy = h * nu = 1.4 (eV) let omega = hnu / hbar; // omega = hnu / hbar (rad/fs) let x = amp * cos(omega * t); // electric field at `x` direction at time `t` let y = amp * sin(omega * t); // electric field at `y` direction at time `t` let z = 0.0; // no electric field at `z` direction let duration = 1000.0; // Pulse duration, 1000 fs let omega_envelop = 2.0 / duration * pi; // Envelop angular frequency let envelop = if t <= duration { sin(omega_envelop*t - 0.5*pi) * 0.5 + 0.5; } else { 0.0 }; return [x*envelop, y*envelop, z*envelop]; // this statement is required.
} Generate Hamiltonian $ namd_lmi hamil -c 02_hamil_config_template.toml
